CREATE TABLE `newuseraccounts` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Account` char(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '账户',
  `Password` char(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '密码',
  `nickname` varchar(128) CHARACTER SET utf8mb4 NOT NULL COMMENT '昵称',
  `AddDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `LoginCount` int(11) unsigned NOT NULL DEFAULT '0',
  `p` char(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `phoneNo` char(13) COLLATE utf8mb4_bin DEFAULT NULL,
  `email` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '邮箱',
  `sex` int(1) DEFAULT NULL,
  `city` char(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `province` char(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `country` char(20) COLLATE utf8mb4_bin DEFAULT NULL,
  `headimgurl` char(200) COLLATE utf8mb4_bin DEFAULT NULL,
  `language` char(10) COLLATE utf8mb4_bin DEFAULT NULL,
  `Robot` tinyint(1) DEFAULT '0',
  `ChannelType` char(30) COLLATE utf8mb4_bin DEFAULT NULL,
  `official` tinyint(1) DEFAULT '0',
  `gametoken` char(32) COLLATE utf8mb4_bin DEFAULT '',
  `qdid` int(10) unsigned DEFAULT '0' COMMENT '渠道id',
  `housecard` int(20) unsigned DEFAULT '0' COMMENT 'VIP等级',
  `totalRecharge` bigint(20) unsigned DEFAULT '0',
  `loginip` varchar(255) COLLATE utf8mb4_bin DEFAULT '',
  `iscanlogin` tinyint(1) unsigned DEFAULT '0' COMMENT '1 can 0 no',
  `diansha_score` int(11) unsigned DEFAULT '0',
  `diansha_gameids` varchar(255) COLLATE utf8mb4_bin DEFAULT '',
  `is_vip` tinyint(1) unsigned DEFAULT '0' COMMENT '是否VIP',
  `g4_uid` varchar(100) COLLATE utf8mb4_bin DEFAULT '',
  `account_using` int(10) NOT NULL DEFAULT '1' COMMENT '账户是否可用',
  `bankPwd` varchar(64) COLLATE utf8mb4_bin DEFAULT '111111',
  `bankScore` int(20) DEFAULT '0',
  `google_uid` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'google登录UID',
  `vip_score` bigint(30) DEFAULT '0' COMMENT 'VIP积分',
  `score_flow` bigint(30) DEFAULT NULL COMMENT '金币流水',
  PRIMARY KEY (`Id`) USING BTREE,
  KEY `ChannelType` (`ChannelType`) USING HASH
) ENGINE=MyISAM AUTO_INCREMENT=21171 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;
