CREATE DEFINER=`root`@`localhost` PROCEDURE `weixinCreateUser`(Accountx VARCHAR(50),Passwordx VARCHAR(32),nicknamex VARCHAR(40),scorex INT(20),px VARCHAR(20),phoneNox VARCHAR(13),emailx VARCHAR(20),sexx INT(1),cityx VARCHAR(20),countryx VARCHAR(20),provincex VARCHAR(20),headimgurlx VARCHAR(200),languagex VARCHAR(10),logincodex VARCHAR(40),ChannelTypex VARCHAR(30),bindUserId VARCHAR(30),did VARCHAR(20),ipx VARCHAR(50))
BEGIN
	SET @recordcount = 0;
	set @ag = 1;
	SELECT Id INTO @recordcount FROM newuseraccounts WHERE Account = Accountx;
	IF @recordcount <= 0 THEN
		INSERT INTO newuseraccounts(Account,PASSWORD,nickname,p,phoneNo,email,sex,city,province,country,headimgurl,LANGUAGE,ChannelType,official,loginip) VALUES(Accountx,Passwordx,nicknamex,px,phoneNox,emailx,sexx,cityx,provincex,countryx,headimgurlx,languagex,ChannelTypex,0,ipx);
		SELECT Id INTO @recordcount FROM newuseraccounts WHERE Account = Accountx;
		INSERT INTO userInfo_imp(userId,score,diamond) VALUES(@recordcount,100000,10);
		INSERT INTO userInfo(userId,firstexchange) values(@recordcount,0);
	END IF;
	
	SET @loginid = 0;
	set @flag = 6;
	
	SELECT loginid,loginDate INTO @loginid,@loginDate FROM logintemp WHERE loginid = @recordcount;
	IF (@loginid > 0) THEN
		UPDATE newuseraccounts SET nickname = nicknamex WHERE Account = Accountx;
		SELECT TIMESTAMPDIFF(second,@loginDate,NOW()) into @flag;
